import React from "react";
import CompanyProspectList from "./tableau-entreprises/frontend/src/companyprospect";

const sampleData = [
  {
    nom: "Castorama Paris La Villette",
    adresse: "15 Rue de Flandre, 75019 Paris",
    secteur: "Bricolage & Aménagement",
    resume: "Magasin de bricolage proposant outillage, matériaux, déco et jardinage.",
    site_web: "https://www.castorama.fr",
    linkedin: "https://www.linkedin.com/company/castorama-france/",
    contacts: [
      {
        poste: "Directeur Général",
        nom: "Jean Dupont",
        email: "jean.dupont@castorama.fr",
        telephone: "+33 1 23 45 67 89",
        linkedin: "https://www.linkedin.com/in/jeandupont"
      },
      {
        poste: "Responsable RSE",
        nom: "Sophie Martin",
        email: "sophie.martin@castorama.fr",
        telephone: "+33 1 98 76 54 32",
        linkedin: "https://www.linkedin.com/in/sophiemartin"
      }
    ],
    sources: ["https://www.castorama.fr", "https://fr.linkedin.com/company/castorama-france"]
  },
  {
    nom: "Leroy Merlin Rosa Parks",
    adresse: "159 Boulevard Macdonald, 75019 Paris",
    secteur: "Bricolage & Habitat",
    resume: "Grand magasin de bricolage proposant des produits pour la maison et le jardin.",
    site_web: "https://www.leroymerlin.fr",
    linkedin: "https://www.linkedin.com/company/leroy-merlin/",
    contacts: [
      {
        poste: "Chef de Magasin",
        nom: "Pierre Laurent",
        email: "pierre.laurent@leroymerlin.fr",
        telephone: "+33 1 40 05 25 25",
        linkedin: "https://www.linkedin.com/in/pierrelaurent"
      }
    ],
    sources: ["https://www.leroymerlin.fr", "https://fr.linkedin.com/company/leroy-merlin"]
  }
];

export default function App() {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Entreprises du secteur</h1>
      <CompanyProspectList data={sampleData} />
    </div>
  );
}
